import React,{Fragment} from 'react';
let productsArr=[
    {
        id:"s1",
        name:"Sushi",
        items:"fish",
        amount:12
    },
    {
        id:"s2",
        name:"chapathi",
        items:"flour",
        amount:10
    },
    {
        id:"s3",
        name:"curry",
        items:"vegetables",
        amount:5
    },
]
const Products=()=>{
    let List=productsArr.map(list=>{
        <ul>
             <li>{list.name} {list.items}</li>
        </ul>
       
    })
        return(
       <Fragment>    
            <div>
                {List}
            </div>
        </Fragment>
    )
}
export default Products;
